leadingComments.value:
*
 * class Functor is the primitive class for composing higher functor based class.
 * This class wrap [Ramda](https://ramdajs.com/) for providing Functional programming style method.
 * @example
 * import { Functor } from 'causal-net.core';
 * 
 * (async ()=>{
 *     let functor = new Functor();
 *     console.log(functor.range(10));
 *     console.log(functor.zeros(10));
 *     console.log(functor.ones(10));
 * })();

